    true,nt"url": null,nt"notes": "This submission contains a shapefile of
    heat flow contour lines around the FORGE site located in Milford, Utah. The model
    was interpolated from data points in the Milford_wells shapefile. This heatflow
    model was interpolated from 66 data points using the kriging method in Geostatistical
    Analyst tool of ArcGIS. The resulting model was smoothed 100%. The well dataset
    contains 59 wells from various sources, with lat/long coordinates, temperature,
    quality, basement depth, and heatflow. This data was used to make models of the
    specific characteristics.",nt"license_title": "Creative Commons Attribution",nt"extras":
